class HomeModel {
  HomeModel({
      List<ProjectIdeas>? projectIdeas, 
      List<Benefits>? benefits, 
      StartupStepProgress? startupStepProgress, 
      List<Blogs>? blogs, 
      UserPreference? userPreference, 
      List<Services>? services, 
      StartupIdea? startupIdea,}){
    _projectIdeas = projectIdeas;
    _benefits = benefits;
    _startupStepProgress = startupStepProgress;
    _blogs = blogs;
    _userPreference = userPreference;
    _services = services;
    _startupIdea = startupIdea;
}

  HomeModel.fromJson(dynamic json) {
    if (json['project_ideas'] != null) {
      _projectIdeas = [];
      json['project_ideas'].forEach((v) {
        _projectIdeas?.add(ProjectIdeas.fromJson(v));
      });
    }
    if (json['benefits'] != null) {
      _benefits = [];
      json['benefits'].forEach((v) {
        _benefits?.add(Benefits.fromJson(v));
      });
    }
    _startupStepProgress = json['startup_step_progress'] != null ? StartupStepProgress.fromJson(json['startup_step_progress']) : null;
    if (json['blogs'] != null) {
      _blogs = [];
      json['blogs'].forEach((v) {
        _blogs?.add(Blogs.fromJson(v));
      });
    }
    _userPreference = json['user_preference'] != null ? UserPreference.fromJson(json['user_preference']) : null;
    if (json['services'] != null) {
      _services = [];
      json['services'].forEach((v) {
        _services?.add(Services.fromJson(v));
      });
    }
    _startupIdea = json['startup_idea'] != null ? StartupIdea.fromJson(json['startup_idea']) : null;
  }
  List<ProjectIdeas>? _projectIdeas;
  List<Benefits>? _benefits;
  StartupStepProgress? _startupStepProgress;
  List<Blogs>? _blogs;
  UserPreference? _userPreference;
  List<Services>? _services;
  StartupIdea? _startupIdea;

  List<ProjectIdeas>? get projectIdeas => _projectIdeas;
  List<Benefits>? get benefits => _benefits;
  StartupStepProgress? get startupStepProgress => _startupStepProgress;
  List<Blogs>? get blogs => _blogs;
  UserPreference? get userPreference => _userPreference;
  List<Services>? get services => _services;
  StartupIdea? get startupIdea => _startupIdea;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_projectIdeas != null) {
      map['project_ideas'] = _projectIdeas?.map((v) => v.toJson()).toList();
    }
    if (_benefits != null) {
      map['benefits'] = _benefits?.map((v) => v.toJson()).toList();
    }
    if (_startupStepProgress != null) {
      map['startup_step_progress'] = _startupStepProgress?.toJson();
    }
    if (_blogs != null) {
      map['blogs'] = _blogs?.map((v) => v.toJson()).toList();
    }
    if (_userPreference != null) {
      map['user_preference'] = _userPreference?.toJson();
    }
    if (_services != null) {
      map['services'] = _services?.map((v) => v.toJson()).toList();
    }
    if (_startupIdea != null) {
      map['startup_idea'] = _startupIdea?.toJson();
    }
    return map;
  }

}